pragma solidity  >=0.5.0 <0.8.0;


// keccak 256, sha 256, ripemd160 take input as a bytes ( no limit )but give output bytes32, bytes32, bytes20.


contract hash{


function hashkecchak256(uint _x, string memory name, address add) public pure returns(bytes32){

// return keccak256(abi.encode (_x, name, add));
return keccak256(abi.encodePacked (_x, name, add)); // en
}


function hashsha256(uint _x, string memory name, address add) public pure returns(bytes32){
return sha256(abi.encode(_x, name, add));
}




function hashripemd160(uint _x, string memory name, address add) public pure returns(bytes20){
return ripemd160 (abi.encode(_x, name, add));


}


}
